v2.ondemand","description":"Este curso enfoca os conceitos e as ferramentas por trás da comunicação de análises de dados modernas de forma reproduzível. A pesquisa reproduzível é a ideia de que as análises de dados e, de modo mais geral, as afirmações científicas, sejam publicadas com seus dados e código de software para que outras pessoas possam verificar as descobertas e desenvolvê-las.  A necessidade de reprodutibilidade está aumentando drasticamente à medida que as análises de dados se tornam mais complexas, envolvendo conjuntos de dados maiores e cálculos mais sofisticados. A reprodutibilidade permite que as pessoas se concentrem no conteúdo real de uma análise de dados, e não em detalhes superficiais relatados em um resumo escrito. Além disso, a reprodutibilidade torna uma análise mais útil para outras pessoas porque os dados e o código que realmente conduziram a análise estão disponíveis. Este curso se concentrará em ferramentas de análise estatística alfabetizadas que permitem a publicação de análises de dados em um único documento que permite que outras pessoas executem facilmente a mesma análise para obter os mesmos resultados.","id":"-4ffSHNYEeWIfhKr_WcYsQ","slug":"reproducible-research","name":"Pesquisa reproduzível","startDate":1451943133025,"courseProgress":"129180404~-4ffSHNYEeWIfhKr_WcYsQ","v2Details":{"plannedLaunchDate":"January 4, 2016","id":"-4ffSHNYEeWIfhKr_WcYsQ","onDemandSessions":["umiVt3LXEeao2hIYaPJ5Xw","Jkip2P9UEeWZ8AoH1Zkwbw","kNqfgytVEeaoXg7YgQ2Cfw","mtlIma9ZEeacMgpsL9-F5g","qECLuXH1EeqL6g5paMWaKw","Y7WnSV7tEem2gw70AsI_Jg","tnyrSmntEemYswohdV3bvg","kXRO16ZvEemZ0ArxLAOQcg","wEkxjZPYEeaHgwrC2Qe0CQ","AmvSVscAEeuMUg7ZSs7-xw","efODWj0LEe2magp5836EBw","vIi-QeUIEeykCA4W5OBcVQ","RtVqzlReEeep9w5HRnu7Hg","e5fgX-hxEempsQ7t7hvirg","mcwPca53EeqCyAp4bN1nxw","t49spSrkEeiNXhLMax05FA","tD3mm6bgEee1fxJ_AEil0g","b-3VYdVpEeioKxK3qQCMlA","PbY6u_WJEeyoHBLnfQUilw","XrD2tThsEemIgxJM3-tMzg","0xOZ6YeFEeyHkwoE2WFhsQ","oePpXRpkEei8FArlCpD_mg","OuUKMLD_Eeuz4RK0U25kq
